import './liveprojects.scss';
import OnlineProject from './../onlineprojects/onlineprojects.component';

function Liveproject() {
    return (
        <div className="live-project">
            <Container>
                <div className="live_project_heading">
                    <h2 className="text-center">Live Portfolio Projects</h2>
                    <p className="text-center">Lorem ipsum, dolor sit amet consectetur adipisicing elit. Distinctio, dolorum!</p>
                </div>
                <br/>
                <Row>
                <OnlineProject name="Url Shortner" description="This project is built using react as frontend , Node Js as Backend and Mysql as database" git="https://github.com/ijoshuadaniel/urlshortner" url="https://url.joshuadaniel.me"/><br/><br/>
